class Solution:
    def punishmentNumber(self, n: int) -> int:
        def check(i):
            square = str(i * i)
            for j in range(1, len(square)):
                if sum(int(x) for x in [square[:j], square[j:]]) == i:
                    return True
            return False

        total = 0
        for i in range(1, n + 1):
            if i == 1 or i == sum([int(x) for x in str(i * i)]) or check(i):
                total += i * i
        return total
